// App.js
import React, { useState } from 'react';
import './App.css';
import Login from './components/Login';
import MainContent from './MainContent';
import PredictionPage from './components/PredictionPage';
import { PredictionProvider } from './components/PredictionContext';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [predictionData, setPredictionData] = useState(null);

  // Callback function to set the user as logged in
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  // Callback function to set the user as logged out
  const handleLogout = () => {
    const confirmLogout = window.confirm('Are you sure you want to logout?');
    if (confirmLogout) {
      setIsLoggedIn(false);
    }
  };

  // Callback function to set prediction data
  const handlePrediction = (data) => {
    setPredictionData(data);
  };

  return (
    <div className="app">
      {isLoggedIn && (
        <div className="logout-button" onClick={handleLogout}>
          Logout
        </div>
      )}

      <div className="content">
        {isLoggedIn ? (
          <MainContent onPrediction={handlePrediction} />
        ) : (
          <Login onLogin={handleLogin} />
        )}
        {predictionData && (
          <PredictionPage predictionData={predictionData} />
        )}
      </div>
    </div>
  );
}

export default App;
